  \"2015-08-14T06:38:30.215787\",\n\t\"name\": \"online-list-of-antidumping-and-antisubsidy-countervailing-duty-measures-involvin\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Comprehensive listing of foreign antidumping
  and antisubsidy (countervailing duty) actions involving U.S. exports.  Actions (whether
  active investigations, measures or reviews) are listed by country and are tracked
  regularly and updated as needed.  Information regarding each action includes date
  of initiation, preliminary and final determinations and the associated range of
  AD/CVD measures in the form of duties or margins, other countries affected by the
  measure and when the measure is terminated or expires.  Users are able to review
  all active actions for a particular foreign country, as well as view the historical
  archive of foreign AD/CVD actions.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
